import React from 'react';
import '../../App.css';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import Container from 'react-bootstrap/Container';
import Table from 'react-bootstrap/Table';

export default function Gisindex() {
  return (
    <>

      <b className="d-flex align-items-center justify-content-center mx-sm-auto my-md-5" style={{background: "#FBDDD1", width:"60%"}}>Summary of GIS Based Applications received on e-service "NOC in respect of Block Forest " </b>
      <Container modal-footer me-lg-5>
      <Row>
      <Col xs={3}> <b>Number of Applications</b></Col> 
      <Col xs={3}><b>Approved Applications</b></Col> 
      <Col xs={2}><b>Rejected Applications</b></Col> 
      </Row>
    </Container>
    </>
  );
}
